description:
Disturbed is an American heavy metal band from Chicago. The band includes vocalist David Draiman, bassist John Moyer, guitarist Dan Donegan, and drummer Mike Wengren. Former band members are vocalist Erich Awalt and bassist Steve Kmak.

The band has released six studio albums, five of which have consecutively debuted at number one on the Billboard 200. Disturbed went into hiatus in October 2011, during which the band's members focused on various side projects, and returned in June 2015, releasing their first album in five years, Immortalized, on August 21, 2015.

Discography:
(2000) The Sickness;
(2002) Believe;
(2005) Ten Thousand Fists;
(2008) Indestructible;
(2010) Asylum;
(2015) Immortalized
